<p>Git每次提交代码，都需要写<code>Commit message</code>，好的规范例如：<a href="https://github.com/angular/angular/blob/22b96b9/CONTRIBUTING.md#-commit-message-guidelines" target="_blank" rel="noopener noreferrer">Angular规范</a>，可以帮助我们：</p>
<ul>
